Woody Allen: A Documentary (BBC)

Arts Documentary hosted by Alan Yentob, published by BBC broadcasted as part of BBC Imagine series in 2013 - English narration


Information
------------------------------

Imagine presents Robert B. Weide's intimate study of the multi-Oscar winning New York auteur.
Produced by Whyaduck Productions 2011.
Part 1.
Woody Allen talks candidly about his childhood in Brooklyn, his early fame as a stand-up in New York City and his first forays into screenwriting and filmmaking. He discusses his prolific body of work, which includes some of the most memorable cinematic moments of all time. With unprecedented access to the director, Weide reveals the man behind the trademark glasses.
Part 2.
Woody Allen discusses his sometimes controversial relationships with the leading ladies in his life, as well as the hits and misses of an unparalleled body of work spanning five decades of filmmaking. Contributors including Martin Scorsese, Diane Keaton, Scarlett Johansson and John Cusack join Allen's family of filmmakers for a unique insight into one of the most obsessive and enduring directors of all time.

